The mean value of the Accuracy Dimension cannot be calculated because there are no values available in the provided dataset. The only metric that has been measured within this dimension is the Accuracy Score, which has consistently returned a value of 0.0 across all datasets and dates.

Here's an example of one such measurement:

```
{
    "@id": "http://example.org/measurement/LemmaBank/2025-07-13/Accuracy score",
    "@type": ["dqv:QualityMeasurement"],
    "dqv:computedOn": {
        "@id": "http://example.org/dataset/LemmaBank"
    },
    "dqv:isMeasurementOf": {
        "@id": "http://example.org/Quality-Metric/Accuracy score"
    },
    "dqv:value": "0.0",
    "prov:generatedAtTime": "2025-07-13"^^xsd:date
}
```

The highest observed score in the Verifiability dimension is **0.498333**, which was achieved by multiple datasets on different dates.

Here's an example of one such dataset with this score:

```
{
  "@id": "http://example.org/measurement/NoiPA/2025-07-13/Verifiability%20score",
  "@type": [
    "dqv:QualityMeasurement"
  ],
  "dqv:computedOn": {
    "@id": "http://example.org/dataset/NoiPA"
  },
  "dqv:isMeasurementOf": {
    "@id": "http://example.org/Quality-Metric/Verifiability%20score"
  },
  "dqv:value": "0.4983333333333333",
  "prov:generatedAtTime": "2025-07-13"^^xsd:date
}
```
